import { useState } from "react";
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        { LinkInput() }
      </header>
      <label></label>
    </div>
  );
}

// Define text input for links
function LinkInput() {


  return (
    <input name="SoundCloud URL Input"/>
  )
}

export default App;
